    return ( <
        >
        <
        Header / >
        <
        Container maxWidth = "lg" >
        <
        Routes >
        <
        Route path = "/"
        element = { < Home / > }
        /> { /*<Home />*/ } { /*<FullPost />*/ } { /*<AddPost />*/ } { /*<Login />*/ } { /*<Registration />*/ } <
        /Routes> <
        /Container> <
        />
    );
}

export default App;
